{% block title %}Créer un Espace{% endblock %}

{% block body %}
<div class=\"container mt-5\">
  <div class=\"row justify-content-center\">
    <div class=\"col-lg-8\">
      <div class=\"card shadow-lg border-0 rounded-4\">
        <div class=\"card-body p-5\">
          <h2 class=\"mb-4 text-center\">Créer un nouvel Espace</h2>

          {{ form_start(form, {'attr': {'novalidate': 'novalidate'}}) }}

          <div class=\"mb-3\">
            {{ form_label(form.nomEspace, null, {'label_attr': {'class': 'form-label'}}) }}
            {{ form_widget(form.nomEspace, {'attr': {'class': 'form-control'}}) }}
            <div class=\"text-danger mt-1\">{{ form_errors(form.nomEspace) }}</div>
          </div>

          <div class=\"mb-3\">
            {{ form_label(form.adresse) }}
            {{ form_widget(form.adresse, {'attr': {'class': 'form-control'}}) }}
            <div class=\"text-danger mt-1\">{{ form_errors(form.adresse) }}</div>
          </div>

          <div class=\"mb-3\">
            {{ form_label(form.capacite) }}
            {{ form_widget(form.capacite, {'attr': {'class': 'form-control'}}) }}
            <div class=\"text-danger mt-1\">{{ form_errors(form.capacite) }}</div>
          </div>

          <div class=\"mb-3\">
            {{ form_label(form.disponibilite) }}
            {{ form_widget(form.disponibilite, {
              'attr': {
                'class': 'form-control',
                'readonly': 'readonly'
              },
              'value': 'Disponible'
            }) }}
            <div class=\"text-danger mt-1\" style=\"font-size: 0.95rem;\">
              {{ form_errors(form.disponibilite) }}
            </div>
          </div>

          <div class=\"mb-3\">
            {{ form_label(form.prix) }}
            {{ form_widget(form.prix, {'attr': {'class': 'form-control'}}) }}
            <div class=\"text-danger mt-1\">{{ form_errors(form.prix) }}</div>
          </div>

          <div class=\"mb-3\">
            {{ form_label(form.Type_espace) }}
            {{ form_widget(form.Type_espace, {'attr': {'class': 'form-control'}}) }}
            <div class=\"text-danger mt-1\">{{ form_errors(form.Type_espace) }}</div>
          </div>

          <div class=\"mb-3\">
            {{ form_label(form.image) }}
            {{ form_widget(form.image, {'attr': {'class': 'form-control'}}) }}
            <div class=\"text-danger mt-1\">{{ form_errors(form.image) }}</div>
          </div>

          {{ form_widget(form.user, {'attr': {'style': 'display: none'}}) }}

          <div class=\"text-center\">
            <button class=\"btn btn-primary px-4\">{{ button_label|default('Enregistrer') }}</button>
          </div>

          {{ form_end(form) }}
        </div>
      </div>
    </div>
  </div>
</div>
{% endblock %}
